import React from "react";
import Navbar from "../Navbar/Navbar";
import { Link } from "react-router-dom";


const Home = () => {
  return (
    <div>
      <Navbar />
     <Link to="/QuestionChoice">
        <button>Start Quiz</button>
      </Link>
    </div>
  );
};

export default Home;
